import React from "react";
import {UserType} from "../../redux/users-reducer";
import styles from './Users.module.scss'

type UsersPropsType = {
    users: Array<UserType>
    follow: (userId: number) => void
    unfollow: (userId: number) => void
    setUsers: (users: Array<UserType>) => void
}

export const Users = (props: UsersPropsType) => {

    if (props.users.length === 0) {
        props.setUsers([
            {id: 1, photoUrl:'data:image/jpeg;base64,', followed: true, fullName: 'Dmitry', status: 'I am a boss', location: {city: 'Minsk', country: 'Belarus'}},
            {id: 2, photoUrl:'data:image/jpeg;base64,', followed: true, fullName: 'Alex', status: 'I am a moss', location: {city: 'Moscow', country: 'Russia'}},
            {id: 3, photoUrl:'data:image/jpeg;base64,', followed: false, fullName: 'Bob', status: 'I am a hoss', location: {city: 'Kiev', country: 'Ukraine'}}

        ])
    }

    return (
        <div>
            {
                props.users.map( u => <div key={u.id}>
                    <span>
                        <div>
                            <img src={u.photoUrl} className={styles.usersPhoto}/>
                        </div>
                        <div>
                            { u.followed
                                ? <button onClick={() => {props.unfollow(u.id)}}>Unfollow</button>
                                : <button onClick={() => {props.follow(u.id)}}>Follow</button>}
                        </div>
                    </span>
                    <span>
                        <span>
                            <div>{u.fullName}</div><div>{u.status}</div>
                        </span>
                        <span>
                            <div>{u.location.country}</div><div>{u.location.city}</div>
                        </span>
                    </span>
                </div>)
            }
        </div>
    )
}